import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ResultPage.css';
import logo from './assets/sonar-logo.png';
import { useLocation, useNavigate } from 'react-router-dom';

const ResultPage = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const [loading, setLoading] = useState(true);
    const [result, setResult] = useState(location.state?.result || null);
    const [sector, setSector] = useState('');
    const [sectorResults, setSectorResults] = useState(null);
    const file = location.state?.file;

    useEffect(() => {
        const uploadFile = async () => {
            if (!file) return;

            const formData = new FormData();
            formData.append('file', file);

            try {
                const response = await axios.post('http://127.0.0.1:5000/upload', formData, {
                    headers: {
                        'Content-Type': 'multipart/form-data'
                    }
                });
                setResult(response.data);
            } catch (error) {
                console.error('Error uploading file:', error);
                setResult('An error occurred while processing the file.');
            } finally {
                setLoading(false);
            }
        };

        uploadFile();
    }, [file]);

    const handleGoBack = () => {
        navigate('/');
    };

    const handleSectorSubmit = async () => {
        try {
            const response = await axios.post('http://127.0.0.1:5001/query', { sector, filename: file.name });
            setSectorResults(response.data);
            navigate('/result2', { state: { result, sectorResults: response.data } });
        } catch (error) {
            console.error('Error fetching sector results:', error);
        }
    };

    const formatResult = (data) => {
        let formattedResult = [];
        if (data["TOC Pages"]) {
            formattedResult.push(
                <tr key="toc">
                    <td>Table of Contents</td>
                    <td>{data["TOC Pages"].replace(/Page\s+/g, '')}</td>
                </tr>
            );
        }
        if (data["Sections"]) {
            formattedResult = formattedResult.concat(
                Object.entries(data["Sections"]).map(([key, value]) => (
                    <tr key={key}>
                        <td>{key}</td>
                        <td>{value.replace(/Page\s+/g, '')}</td>
                    </tr>
                ))
            );
        }
        return formattedResult;
    };

    return (
        <div className="result-page">
            <div className="menu-bar">
                <div className="logo-container" onClick={handleGoBack}>
                    <img src={logo} alt="Sonar Logo" className="homepage-logo" />
                </div>
            </div>
            {loading ? (
                <div className="loading-screen">
                    <img src={logo} alt="Sonar Logo" className="loading-logo" />
                    <p className="loading-text">Sonar is analyzing your file</p>
                </div>
            ) : (
                <div className="result-container fade-in">
                    <h2 className="result-title">{file?.name}</h2>
                    <table className="result-table">
                        <thead>
                            <tr>
                                <th>Section Name</th>
                                <th>Pages</th>
                            </tr>
                        </thead>
                        <tbody>
                            {result && formatResult(result)}
                        </tbody>
                    </table>
                    <div className="prompt-container">
                        <label htmlFor="sector-input">What sector do you work in?</label>
                        <input
                            type="text"
                            id="sector-input"
                            value={sector}
                            onChange={(e) => setSector(e.target.value)}
                        />
                        <button className="sector-submit-button" onClick={handleSectorSubmit}>Submit</button>
                    </div>
                    <button className="back-button" onClick={handleGoBack}>Back</button>
                </div>
            )}
        </div>
    );
};

export default ResultPage;
